    "import base64\n",
    "from openai import OpenAI\n",
    "import cv2\n",
    "import matplotlib.pyplot as plt\n",
    "import sys\n",
    "\n",
    "client = OpenAI(api_key=\"your api key\")\n",
    "MODEL = \"gpt-4o\"\n",
    "image_files = [\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/0.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/1.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/2.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/3.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/4.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/5.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/6.jpg\",\n",
    "    \"C:/Users/USER/Desktop/klenv1R338/label/chair/7.jpg\"\n",
    "]\n",
    "\n",
    "base64_images = []\n",
    "for image_file in image_files:\n",
    "    with open(image_file, \"rb\") as img_file:\n",
    "        base64_images.append(base64.b64encode(img_file.read()).decode('utf-8'))\n",
    "\n",
    "plt.figure(figsize=(20, 5))\n",
    "for j, file in enumerate(image_files):\n",
    "    image = cv2.imread(file)\n",
    "    image_rgb = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)\n",
    "    plt.subplot(1, len(image_files), j+1)\n",
    "    plt.imshow(image_rgb)\n",
    "    plt.axis('off')\n",
    "plt.tight_layout()\n",
    "plt.show()\n",
    "\n",
    "start_instruction = \"Based on user input, identify the specific object in the image by progressively narrowing down the possibilities. If multiple objects match the description in each interaction, inform me of the number of potential matches and their IDs. Use each round of user input to refine your guesses until the unique object is confirmed by the user. Apply all previous hints to focus on the correct object and always provide the object ID with your guesses.\"\n",
    "\n",
    "messages = [{\"role\": \"system\", \"content\": start_instruction}]\n",
    "\n",
    "i = 0\n",
    "\n",
    "while True:\n",
    "    print(\"Round\",i+1,\"Dialogue\")\n",
    "    user_input = input(\"請輸入描述（輸入 'ee' 來結束）：\")\n",
    "    print(\"Me:\", user_input)   \n",
    "    i += 1\n",
    "\n",
    "    if user_input.lower() == \"ee\":\n",
    "        break\n",
    "\n",
    "    messages.append({\"role\": \"user\", \"content\": [\n",
    "        {\"type\": \"text\", \"text\": user_input},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[0]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[1]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[2]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[3]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[4]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[5]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[6]}\"}},\n",
    "        {\"type\": \"image_url\", \"image_url\": {\"url\": f\"data:image/png;base64,{base64_images[7]}\"}}\n",
    "    ]})\n",
    "    \n",
    "    response = client.chat.completions.create(\n",
    "        model=MODEL,\n",
    "        messages=messages,\n",
    "        temperature=0.0,\n",
    "    )\n",
    "    ai_message = response.choices[0].message.content\n",
    "    messages.append({\"role\": \"assistant\", \"content\": ai_message})\n",
    "    \n",
    "    print(\"gpt-4o:\", ai_message)\n",
    "    sys.stdout.flush()\n",
    "\n",
    "    print(\"\")\n",
    "\n",
    "    if i > 10:\n",
    "        print(\"please ask again\")\n",
    "        messages.clear()\n",
    "        break"
